import { FC } from "react";
import { OrderResponse } from "../types/order-response-type";

type TradeListProps = {
    tradeList: OrderResponse[]
}

export const TradeList: FC<TradeListProps> = ({ tradeList }) => {
    return (
        <div className="bg-white rounded-md h-40 w-3/4">
            {
                tradeList.map(trade => {
                    return (
                        <div>
                            {trade.side}
                            {trade.type}
                            {trade.asset}
                            {trade.quantity}
                            {trade.price}
                            {trade.notional}
                        </div>
                    )
                })
            }
        </div>
    )
}
